import React from 'react';
import './Move.css';

function Move(props) {
    return (
        <div className={`Move ${props.selected ? 'selected' : ''}`} onClick={() => props.selectMove(props.id)}>
            <span className="TurnId">#{props.id + 1}</span> {props.value}
        </div>
    );
}

export default Move;
